oxy_webhelp_navlinks = {"amazon_s3_inventory_management-d22872e13899":{"topics":[{"title":"Accessing the AWS S3 page","shortdesc":"<p class=\"shortdesc\">Access the AWS S3 inventory page from the Data Protection dashboard to view, manage,         and protect the Amazon S3 buckets. You can also take on-demand snapshots of the S3 buckets         from the AWS S3 inventory page and recover the S3 buckets and their objects using the Export         and In-place recovery options from the corresponding S3 bucket snapshot page.<\/p>","href":"amazon_S3\/accessing_aws_s3_page.html","attributes":{"data-id":"accessing_aws_s3_page"},"menu":{"hasChildren":false},"tocID":"accessing_aws_s3_page-d22872e13910","topics":[]},{"title":"Taking on-demand snapshots of Amazon S3 buckets","shortdesc":"<p class=\"shortdesc\">In addition to policy-based snapshots, take an on-demand snapshot of Amazon S3         buckets to protect the information that resides in the buckets.<\/p>","href":"amazon_S3\/taking_ods_amazon_s3_buckets.html","attributes":{"data-id":"taking_ods_amazon_s3_buckets"},"menu":{"hasChildren":false},"tocID":"taking_ods_amazon_s3_buckets-d22872e13921","topics":[]}]}};